import React from "react";
import "./logo.css";

const Logo = () => {
  return (
    <div className="logo">
      <div>{"<"}</div>
      <div className="logo-wheel-odd">I A F A R</div>
      <div className="logo-wheel-even">A F A R I</div>
      <div className="logo-wheel-odd">F A R I A</div>
      <div className="logo-wheel-even">A R I A F</div>
      <div className="logo-wheel-odd">R I A F A</div>
      <div>{"/>"}</div>
    </div>
  );
};

export default Logo;
